import React from 'react';
import classes from './Maze.module.css';
import styled from 'styled-components';

const Maze = (props) => {
    let rows = props.dim[0];
    let columns = props.dim[1];
    let heightPerBox = 100/rows;
    let widthPerBox = 100/columns;

    let squareStyle = {
        display: 'grid',
        gridTemplateColumns: '8ch auto'
    };

    console.log(`Height: ${heightPerBox}\nWidth ${widthPerBox}`)

    const createBoxGrid = () => {
        // Create 2d array for each box
        const map = [];
        for (let i = rows-1; i >= 0; i--){
            for (let j = 0; j < columns; j++) {
                map.push([i,j]);
            }
        }
        //creates jsx to display boxes
        let displayGrid = map.forEach((position) => {
            let currentRow = position[0];
            let currentColumn = position[1];
            console.log(`row ${currentRow}\ncolumn ${currentColumn}`)
        });
    }

    createBoxGrid();

    return(
        <div className={props.className}>
            hi
        </div>
    );
};

export default Maze;
